import Footer from "./components/Footer"
import Section from "./components/Section";
import IconSection from "./components/IconSection";


function App() {
  return (
    <main>
      <Header />
      <IconSection />
      <Header reverse />
      <Footer />
    </main>
  );
}

export default App;
